CREATE DEFINER=`root09`@`%` FUNCTION `calculate_price_from_confidence`(
PRICE_IN float,
CONFIDENCE_LEVEL_IN float,
EXPIRY_FACTOR_QUOTIENT_IN float,
EXPIRY_FACTOR_IN float ) RETURNS float
    READS SQL DATA
    DETERMINISTIC
BEGIN

DECLARE CALCULATED_BUY_PRICE FLOAT DEFAULT 0;


